import style from './Action.module.css'
import photoAction from '../photos/photoAction.png'

const Action = () => {
  return (
    <div className={style.frameAction}>
      <div className="textAction"></div>
      <div className={style.imgOfAction}>
        <img src={photoAction} alt />
      </div>
    </div>
  )
}

export default Action
